import React from 'react';
import UserItem from './UserItem';

const UsersList = (props) => {


  return (
    <ul>
      {props.items.map((item) => {
        return (
          <UserItem
            key={item.id}
            Item={item.id}
            image={item.image}
            name={item.name}
            placeCount={item.placeCount}
          />
        );
      })}
    </ul>
  );
};
export default UsersList;
